class UVServiceWorker{constructor(){this.cache=new Map()}fetch(e){const r=e.request;if(this.cache.has(r.url)){return new Response(this.cache.get(r.url),{status:200,headers:{"Content-Type":"text/html"}});}return fetch(r).then(t=>t.text()).then(d=>{this.cache.set(r.url,d);return new Response(d,{status:200,headers:{"Content-Type":"text/html"}});}).catch(e=>new Response("Error fetching: "+e.message,{status:500,headers:{"Content-Type":"text/plain"}}));}}
